import React from 'react';
import { NavLink } from 'react-router-dom';

const Home = () => {
  return (
    <>
        <NavLink activeClassName="ac" to="/"> AboutUs </NavLink>
        <NavLink to="/contact"> Contact </NavLink>
    </>
  )
}

export default Home
